import React from "react";
import "./Style.css";
const Admin = () => {
  return (
    <section>
      <div>User List</div>
      <span>
        <h4>Total Count : 4</h4>
        <button className="btn">Create User</button>
      </span>
    </section>
  );
};
export default Admin;
